import React, { Component } from "react";
import { Breadcrumb, Icon, Row, Col, Layout, Card, Carousel, Input, Button, Divider } from "antd";
import { fetchProfiles } from "../../redux/actions/dashboardAction";
import { connect } from "react-redux";
import SideMenuLeft from "../Common/SideMenuLeft";
import PreviewModel from "../Common/PreviewModal";
import PostCard from "../Common/PostCard";
// import "../../static/css/style.scss";
class Dashboard extends Component {
  state = {
    isModal: false,
    list: [
      {
        name: "kiayara",
        surname: "advani",
        profile: "https://travelandleisureindia.in/wp-content/uploads/2019/09/kiara-feature-2.jpg",
      },
      {
        name: "sikandar",
        surname: "kumar",
        profile: "https://travelandleisureindia.in/wp-content/uploads/2019/09/kiara-feature-2.jpg",
      },
      {
        name: "sikandar",
        surname: "kumar",
        profile: "https://travelandleisureindia.in/wp-content/uploads/2019/09/kiara-feature-2.jpg",
      },
      {
        name: "sikandar",
        surname: "kumar",
        profile: "https://travelandleisureindia.in/wp-content/uploads/2019/09/kiara-feature-2.jpg",
      },
      {
        name: "sikandar",
        surname: "kumar",
        profile: "https://travelandleisureindia.in/wp-content/uploads/2019/09/kiara-feature-2.jpg",
      },
      {
        name: "sikandar",
        surname: "kumar",
        profile: "https://travelandleisureindia.in/wp-content/uploads/2019/09/kiara-feature-2.jpg",
      },
    ],
  };

  componentDidMount() {
    this.props.fetchProfiles();
  }
  showModal = () => {
    console.log("works");
    this.setState({ isModal: true });
  };
  clickHandler = () => {
    console.log("working.........");
  };
  changeHandler = (e) => {
    if (e.target.value.split(" ")) {
      console.log(e.target.value);
    }
  };

  render() {
    const { users } = this.props;
    const { isModal } = this.state;
    return (
      <div>
        <Row>
          <Col span={4}>
            <SideMenuLeft />
          </Col>
          <Col span={14} className="post-display">
            {this.state.list
              ? this.state.list.map((i, j) => {
                  return (
                    <Row>
                      <PostCard />
                    </Row>
                  );
                })
              : null}
          </Col>
          <Col span={6}>
            <div className="right">sikandar</div>
          </Col>
        </Row>
        {isModal ? <PreviewModel /> : null}
      </div>
    );
  }
}
const mapStateToProps = (state) => {
  return {
    users: state.profiles,
  };
};
function mapDispatchToProps(dispatch) {
  return {
    fetchProfiles: (data) => {
      dispatch(fetchProfiles(data));
    },
  };
}
export default connect(mapStateToProps, mapDispatchToProps)(Dashboard);
